%[text] %[text:anchor:T_0FF0FA7E] # Optimal Detection for the Vector AWGN Channel (minimum-distance detector)
%[text] This function estimates noisy complex symbol values using the minimum Euclidean distance as an estimator with respect to some QAM constellations.
%[text] <u>**Inputs:**</u>
%[text] - *symb\_RX*: noisy RX symbol vector of size *nb\_symb x 1* where *nb\_symb = nb\_bit / nb\_bit\_per\_symb*
%[text] - *nb\_bit\_per\_symb*: number of bits per symbol
%[text] - *nb\_symb*: number of symbols in the  symbol stream (= length of *symb\_RX*) \
%[text] <u>**Ouputs:**</u>
%[text] - *symb\_RX\_estimated*: estimated complex symbol stream vector of size *nb\_symb x 1* where *nb\_symb = nb\_bit / nb\_bit\_per\_symb* \
function symb_RX_estimated = symbol_estimation_QAM( symb_RX , nb_bit_per_symb , nb_symb )


symb_RX_estimated = zeros( nb_symb , 1 ) ;
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] %[text:anchor:H_46FBCDFD] ## Minimum-distance detector: theory
%[text] This function implements an optimal detection in the case of a transmission over an additive white Gaussian noise (AWGN) channel whose vector representation can be written as:
%[text] $\\mathbf{r}=\\mathbf{s\_m}+\\mathbf{n}$,          $1\\leq m \\leq M$
%[text] where $\\mathbf{r}$ is the received symbol, $\\mathbf{s\_m}$ is the transmitted symbol among $M$possible symbols within a given constellation, and $\\mathbf{n}$ is a white Gaussiance noise (i.e., its real and imaginary components are i.i.d. zero-mean Gaussian random variables with variance $\\frac{N\_0}{2}$). The vectors considered here are 2-dimensional vectors from a 2D orthonormal plane, and can therefore be conveniently represented in a complex plane (i.e., 2D symbol space \<=\>  IQ plane: $\\mathbf{s\_m}=\\{ I\_m, Q\_m \\}$).
%[text] The role of the estimator at the receiver is to decide which symbol has been sent based on the observation of $\\mathbf{r}$, so the optimal decision rule can be written as:
%[text] $\\hat m = \\arg\\max\_{1\\leq m \\leq M} P\_mp (\\mathbf{r} \\mid\\mathbf{s\_m})$, where $P\_m$ is the *a priori* probability of a given symbol $\\mathbf{s\_m}$ being transmitted and $p (\\mathbf{r} \\mid\\mathbf{s\_m})$ is the conditional probability density function of the received symbol $\\mathbf{r}$ knowing $\\mathbf{s\_m}$ has been transmitted. This is known as the **maximum a posteriori probability (MAP)** rule. It consists in selecting the symbol index $m$ within a *M*-size that by maximizes the probability $P\_mp (\\mathbf{r} \\mid\\mathbf{s\_m})$.
%[text] In the case of equiprobable symbols (i.e., there is the same probability for all symbols within a constellation to be transmitted), $P\_m = \\frac{1}{M}$ for all  $1\\leq m \\leq M$. The optimal detection rule reduces then to: $\\hat m = \\arg\\max\_{1\\leq m \\leq M} p (\\mathbf{r} \\mid\\mathbf{s\_m})$. This is known as the **maximum likelihood estimator (MLE)** *(the MLE is not optimal unless symbols are equiprobable in their occurence).*
%[text] In the scenario of a vector AWGN channel and assuming equiprobability between symbols, both MAP and MLE can be implemented by a **minimum-distance (or nearest-neighbor) detector**:
%[text] $\\hat m = \\arg\\min\_{1\\leq m \\leq M} \\mid\\mid \\mathbf{r} - \\mathbf{s\_m} \\mid\\mid $.
%[text] For more details regarding optimal receiver, see chapter 4 from *"Digital Communications", 5th Edition, J.G Proakis and M. Salehi, McGraw Hill*
%[text] %[text:anchor:H_47149E8C] ## Guidelines: what to do?
%[text] ![](text:image:9ae7)
%[text] The receiver receives $\\mathbf{r}$ and looks among all $\\mathbf{s\_m}$ to find the one that is closest to $\\mathbf{r}$ using standard Euclidean distance. This needs to be done for QPSK and 16QAM mapping.
%[text] In the above example, if the input symbol is *symb\_RX* = **r**, the ouput should then be *symb\_RX\_estimated* = 1 + 1i, since the m=1 symbol is the one that minimizes the Euclidean distance between the received symbol and the symbols from the original constellation.
%[text] 
%[text] %[text:anchor:H_B21E57AC] ## 4QAM constellation (\<=\> QPSK)
%[text] The QPSK constellation is as shown below:
%[text] ![](text:image:36fc)
if nb_bit_per_symb == 2
    
    % Code here the symbol estimation function for QPSK constellation (output: symb_RX_estimated)
    Lm = [-1+1i 1+1i 1-1i -1-1i];

    for k=1:nb_symb
        Ld = dist(symb_RX(k)*ones(1,4),Lm);
        [~,minD] = min(Ld);
        symb_RX_estimated(k) = Lm(minD);
    end
    
end

%[text] %[text:anchor:H_6E4A6F0C] ## 16QAM constellation
%[text] The 16QAM constellation is as shown below:
%[text] ![](text:image:75f0)
if nb_bit_per_symb == 4
    
    % Code here the symbol estimation function for 16QAM constellation (output: symb_RX_estimated)
    Lm = [-3+3i -1+3i +1+3i +3+3i -3+1i -1+1i +1+1i +3+1i -3-1i -1-1i +1-1i +3-1i -3-3i -1-3i +1-3i +3-3i];

    for k=1:nb_symb
        Ld = dist(symb_RX(k)*ones(1,16),Lm);
        [~,minD] = min(Ld);
        symb_RX_estimated(k) = Lm(minD);
    end

end

end
%[text] 
function d = dist(A,B)
    d = sqrt( (real(A)-real(B)).^2 + (imag(A)-imag(B)).^2 );
end

